-- Table: public.score

DROP TABLE IF EXISTS public.score;

CREATE TABLE IF NOT EXISTS public.score
(
    id integer GENERATED ALWAYS AS IDENTITY,
    pseudo character varying COLLATE pg_catalog."default",
    score integer
);

INSERT INTO score(pseudo,score)
VALUES
('Oklahoma Jack',0)
;

-- Table: public.objet

DROP TABLE IF EXISTS public.objet;



CREATE TABLE IF NOT EXISTS public.objet
(
    nom character varying COLLATE pg_catalog."default" NOT NULL,
    point geometry,
    icone character varying COLLATE pg_catalog."default",
    depart boolean,
    inventaire boolean,
    texte character varying COLLATE pg_catalog."default",
    parent character varying COLLATE pg_catalog."default",
    enfant character varying COLLATE pg_catalog."default",
    type character varying COLLATE pg_catalog."default",
    zoom integer,
    lat double precision,
    lon double precision,
    height integer,
    width integer,
    audio character varying COLLATE pg_catalog."default"
);

