('volcan',NULL,'images/mountain.png','f',NULL,'<p>Le Chimborazo est un volcan d’Équateur culminant à <strong>6 268 m</strong> d’altitude et situé près de Riobamba, à environ 180 km au sud de Quito. C’est le sommet le plus haut des Andes équatoriennes, qui domine une région de 50 000 km2, sa base faisant 20 km de diamètre.

Il est surnommé Taita Chimborazo, c’est-à-dire Papa Chimborazo, la mère associée étant Mama Tungurahua.</p>','pagode',NULL,'code',12,-1.4696,-78.8171,60,60,NULL)
,
('cle_blanc',NULL,'images/white_key.png','t','f',NULL,NULL,'coffre_blanc','cle',11,15.6413,32.5057,60,60,NULL)
,
('cle_noir',NULL,'images/black_key.png','t','f',NULL,NULL,'coffre_noir','cle',11,-3.1273,-59.9003,60,60,NULL)
,
('perso2',NULL,'images/cowboy.png','f',NULL,'« Comment ? Vous dites avoir ouvert le portail qui mène à l’Eldorado ? Ha ! C’est parfaitement ridicule ! Un amateur tel que vous ? Je refuse d’y croire ! D’ailleurs, je ne daignerais même pas aller voir ça de mes propres yeux, j’ai bien mieux à faire ! Et puis, de toute façon, si c’était la vérité, vous ne seriez pas là à me parler, vous auriez déjà suivi la ligne comme la suite de la légende l’explique. Et même si vous suiviez cette ligne, comment entreriez-vous dans l''Eldorado sans l''autre clé, hein ? »','perso',NULL,'code',11,-16.4395,-68.1487,64,64,'audio/Moonlight Hall.mp3')
,
('pago2',NULL,'images/shwedagon.png','f',NULL,'Après avoir fouillé dans la pagode, vous avez trouvé un vieux cadenas et y avez inscrit le code que vous avez déduit. Le cadenas s’est ouvert et vous avez pu accéder à une vieille chambre souterraine abandonnée… Au centre de la chambre, vous trouvez un objet qui semble être une sorte de vieille clé maya, ainsi que les inscriptions suivantes :
«ရွှေမြို့တော်ကို ရှာဖွေနေသူတိုင်းသည် မြင့်မားသော အေးချမ်းသာယာသော မြို့တော်သို့ သွားခြင်းဖြင့် ဤသော့ဖြင့် ခရီးဆက်ကြရမည်ဖြစ်သည်။»
Qu''est-ce que cela peut bien vouloir dire ? Vous devriez le traduire et résoudre cette énigme','pagode',NULL,'code',17,16.7983,96.1496,64,64,'audio/The Path of the Goblin King v2.mp3')
,
