('coffre_noir',NULL,'images/black_chest.png','t',NULL,'Un vieux coffre noir. Il faudrait une clé de la même couleur pour l''ouvrir…
Si vous cherchez un fleuve noir, tentez d’aller au Río Negro.','cle_noir','code_noir','coffre',4,43.466,34.246,64,76,NULL)
