('coffre_rouge',NULL,'images/red_chest.png','t',NULL,'Un vieux coffre rouge. Il faudrait une clé de la même couleur pour l''ouvrir…
Si vous cherchez un fleuve rouge, tentez d’aller à la Rivière Rouge, au Mississippi.','cle_rouge','code_rouge','coffre',4,20.434,38.412,64,76,NULL)
,
('eldorado',NULL,'images/eldorado.png','t',NULL,'Serait-ce la porte de l''Eldorado ? Vous êtes sûr que vous êtes presque au bout de votre périple, mais la porte refuse de s''ouvrir... Vous manquerait-il une clé ?','maya','victory','coffre',15,-15.815,-67.8952,128,128,NULL)
,
('pagode',NULL,'images/shwedagon.png','t',NULL,'Dans la pagode Shwedagon, vous apprenez en interrogeant les gens du coin qu’il y a une vieille légende transmise depuis des siècles qui serait en lien avec la pagode. La légende raconte :
« Pour la cité d’or trouver, l’explorateur devra chercher le nombre secret. De 4 chiffres composés, ce nombre est scellé dans 4 coffres qui reposent dans 4 mers colorées, ouverts par 4 clés situées aux bouts de 4 fleuves de même couleur. »
La cité d’or mentionnée par cette légende serait-elle l’Eldorado ? Vous devriez résoudre cette énigme et trouver le nombre à 4 chiffres de la légende pour en savoir plus.
','8524','maya,perso,volcan,pago2','cadenas',17,16.7983,96.1496,64,64,'audio/The Path of the Goblin King.mp3')
,
('perso',NULL,'images/cowboy.png','f',NULL,'« L’Eldorado ? Oui, en effet. Moi, le grand archéologue Oklahoma Jack, j’ai dédié plusieurs années de ma vie à sa recherche. Mais je suis dans une impasse… Je crois bien avoir trouvé un portail dans cette ville qui pourrait m’y mener, mais il faut deux clés pour l’ouvrir. Bien sûr, étant d’une grande perspicacité et d’un intellect infaillible, je suis parvenu à résoudre les énigmes et découvrir l’emplacement des deux clés. Hélas ! La première clé avait déjà disparu, sans doute pillée par un autre explorateur avant moi. Quant à l’autre, je n’en ai pas trouvé la moindre trace, alors que j’ai risqué ma vie pour aller au sommet du mont Everest pour la chercher ! La légende parlait tout de même du lieu « au plus loin du centre de la terre », alors cela devait bien être là-bas… Un tel échec me mets hors de moi, mais soyons réalistes. Ce n’est pas un débutant comme vous qui réussirez là ou j’ai échoué ! »','6268','perso2,ligne','cadenas',11,-16.4395,-68.1487,64,64,NULL)
,
